import "../WhatsAppButton/WhatsAppButton.css";

const WhatsAppButton = () => {
  <a
    href="https://api.whatsapp.com/send?phone=5491150622993&text=Hola%21%20Pedido"
    target="blank"
    class="floatWpp"
  >
    <i class="fab fa-whatsapp iconWpp"></i>
  </a>;
};
export default WhatsAppButton;
